import React from "react";
import { Row, Col } from "react-bootstrap";

export default function MenuBar() {
  return (
    <div id="menuBar">
      <Row>
        <Col xs={3}>convos</Col>
        <Col xs={3}>contacts</Col>
        <Col xs={3}>settings</Col>
        <Col xs={3}></Col>
      </Row>
    </div>
  );
}
